import React, { Component } from 'react'
import Person from "./Components/Person/Person.js";
class App extends Component {
  constructor (props){
    super(props);
    this.state = {
      persons: [
        {
          name: "Anas", age:10
        },
        {
          name: 'Issac', age:20
        },
        {
          name: 'React', age:30
        }
      ],
    };
  }

  render() {
    return (
      <div >
        <Person name={this.state.persons[0].name}></Person>
      </div>
    );
  }
}


export default App;
